import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
    return (
        <div className="home-page">
            <header className="home-header">
                <h1>Welcome to the CV Management Tool</h1>
                <p>Manage your CVs efficiently and effortlessly.</p>
                <Link to="/tool/uploadFile">
                    <button className="btn">Go to CV Tool</button>
                </Link>
            </header>
        </div>
    );
}

export default Home;
